import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="bg-neutral-800 min-h-screen">
      <div className="w-full flex justfy-center text-white">
        "Some profound Quote here"
      </div>
      <div className="bg-black h-[500px] w-[70%] my-[13%] mx-auto"></div>
    </div>
  );
}

export default App;
